  // \u274C The theme does not support configuring element types\n    type: 'rect',\n    style: {\n      // \u274C The theme does not support callback functions\n      fill: (d) => d.style.color,\n    },\n  },\n};\n",paraId:6,tocIndex:1},{value:"For element state styles, please ensure that every property in the state style has a corresponding default style in the default style, otherwise it may result in the inability to clear the state style.",paraId:7},{value:"You can register a theme using the ",paraId:8,tocIndex:2},{value:"register",paraId:8,tocIndex:2},{value:" method provided by G6. Here is an example:",paraId:8,tocIndex:2},{value:"import { register, ExtensionCategory } from '@antv/g6';\n\nregister(ExtensionCategory.THEME, 'custom-theme', theme);\n",paraId:9,tocIndex:2},{value:"To enable and configure a theme, you need to pass the ",paraId:10,tocIndex:3},{value:"theme",paraId:10,tocIndex:3},{value:" option when instantiating the ",paraId:10,tocIndex:3},{value:"Graph",paraId:10,tocIndex:3},{value:":",paraId:10,tocIndex:3},{value:"{\n  theme: 'custom-theme',\n}\n",paraId:11,tocIndex:3},{value:"After the ",paraId:12,tocIndex:4},{value:"Graph",paraId:12,tocIndex:4},{value:" instance is created, you can switch themes by using the ",paraId:12,tocIndex:4},{value:"setTheme",paraId:13,tocIndex:4},{value:" method:",paraId:12,tocIndex:4},{value:"graph.setTheme('dark');\n",paraId:14,tocIndex:4},{value:"Additionally, you can also obtain the current theme by using the ",paraId:15,tocIndex:4},{value:"getTheme",paraId:15,tocIndex:4},{value:" method:",paraId:15,tocIndex:4},{value:"graph.getTheme();\n// => 'dark'\n",paraId:16,tocIndex:4}];},"12ba4c4e":function(e,a,t){"use strict";t.d(a,"__esModule",{value:!0}),t.d(a,"texts",{enumerable:!0,get:function(){return d;}}),t("b6fd8838");let d=[{value:"@antv/g6",paraId:0},{value:" > ",paraId:1},{value:"EdgeLabelStyleProps",paraId:2},{value:" > ",paraId:1},{value:"maxWidth",paraId:3},{value:"The maximum width of the label(need [prefix]W